%             Vy = (0.1e1 ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ (h .^ 2 + k .^ 2 + 1) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* (p1 + l1 .* cos(L - L0)) - p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) .^ 2 ./ (h .^ 2 + k .^ 2 + 1) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* cos(L) .* (f1 + l2 .* cos(L - L0)) - p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) .^ 2 ./ (h .^ 2 + k .^ 2 + 1) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* sin(L) .* (g1 - l2 .* sin(L - L0)) + (-0.2e1 .* p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ ((h .^ 2 + k .^ 2 + 1) .^ 2) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* h + p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ (h .^ 2 + k .^ 2 + 1) .* (-0.2e1 .* h .* sin(L) + 0.2e1 .* k .* cos(L))) .* (h1 + l3 .* cos(L - L0)) + (-0.2e1 .* p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ ((h .^ 2 + k .^ 2 + 1) .^ 2) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* k + p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ (h .^ 2 + k .^ 2 + 1) .* (0.2e1 .* h .* cos(L) + 0.2e1 .* k .* sin(L))) .* (k1 - l3 .* sin(L - L0)) - p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) .^ 2 ./ (h .^ 2 + k .^ 2 + 1) .* (sin(L) - (h .^ 2 - k .^ 2) .* sin(L) + 0.2e1 .* h .* k .* cos(L)) .* (-f .* sin(L) + g .* cos(L)) + p ./ (0.1e1 + f .* cos(L) + g .* sin(L)) ./ (h .^ 2 + k .^ 2 + 1) .* (cos(L) - (h .^ 2 - k .^ 2) .* cos(L) - 0.2e1 .* h .* k .* sin(L))) .* sqrt(mu .* p) .* q .^ 2 ./ p .^ 2;
